import React from "react";


const Slot =() => {
             const a=["üòö","üèπ","üåû"]

            for(let i=0;i<a.length;i++){
 
                    let r=Math.floor(Math.random()*3)
                    
                    let x=a[r]
                    let y=a[r]
                    let z=a[r]
            
    
         
                 if(x===y && y===z){
                            return (
                                    <>
                                       <div className="slot+timer">
                                           <h1>
                                                 {x} {x} {z}
                                           </h1>
                                          <h1>This is matching</h1>
                                       </div>
            
            
                                    </>
                                   )
                 
                                }
            }
    
    }
    export default Slot
